import './Home.css';
import Avatar from '@mui/material/Avatar';

function Home () {
  return (
    <div>
      <div className="home-container">
        <div >
          <img className="avatar-image" alt="Zaul Tavangar" src="/profilePicture.jpeg"/>
        </div>
        <div className="intro-container">
          <span>Hi I'm <b>Zaul</b></span>
          <p>Intro paragraph</p>
        </div>
      </div>
      <div className="aboutme-container">
        <h1>About Me</h1>
      </div>
    </div>

  )
}
export default Home;
